// Importar createApp de Vue
import { createApp } from 'vue';

// Crear una instancia de la aplicaci贸n
const app = createApp({
  data() {
    return {
      count: 0
    };
  },
  methods: {
    increment() {
      this.count++;
    }
  }
});

// Montar la aplicaci贸n en el elemento con id 'app'
app.mount('#app');
